import "./main.css";
import Navbar from '../components/Navbar/Navbar'
import Img from '../assets/my.jpg';

const Home = () => {
    return (
        <div>
            <Navbar/>
            <h1>Home</h1>
         <div className="container">
             <div className="ul" >
                 <div className="ul-plus">
             <h1>I'm Web and Mobile Application Developer
                 <img src={Img} />

                 </h1> 
                 </div>
             </div>
         </div>
        </div>
    )
}

export default Home;
